import { useNavigate } from 'react-router-dom';
import HorarioForm from '../horario/HorarioForm';

function NewHorario() {
  const navigate = useNavigate();

  async function createPost(horario) {
    console.log('Dados enviados:', horario); // Log para depuração

    try {
      const response = await fetch('http://localhost:3000/horarios', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(horario),
      });

      if (!response.ok) {
        const errorData = await response.json();
        console.error('Erro ao criar horário:', errorData); // Log do erro
        return;
      }

      navigate('/horarios', { state: { message: 'Projeto criado com sucesso!' } });
    } catch (error) {
      console.error('Erro ao criar horário:', error); // Log de erro de conexão
    }
  }

  return (
    <div>
      <h1>Criar Horário</h1>
      <p>Crie seu horário para depois adicionar os serviços</p>
      <HorarioForm handleSubmit={createPost} btnText="Criar Horário" />
    </div>
  );
}

export default NewHorario;
